INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (1, N'Obedience Adventure', N'Join us on an exciting journey to master basic obedience commands! This course covers sit, stay, come, and more, making learning fun and rewarding for you and your pup.', N'', CAST(N'2023-09-16T11:30:00.000' AS DateTime), 39)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (2, N'Social Paws Playtime', N'Let''s get social! This course focuses on puppy socialization, providing opportunities for your furry friend to interact with other pups in a safe and controlled environment.', N'', CAST(N'2023-11-30T18:00:00.000' AS DateTime), 153)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (3, N'Crate Escape', N'Discover the magic of crate training in this engaging course. Learn how to introduce your puppy to their crate and make it a cozy retreat they''ll love to call their own.', N'', CAST(N'2024-01-25T17:30:00.000' AS DateTime), 156)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (4, N'Potty Party', N'Say goodbye to accidents! Potty training doesn''t have to be a hassle. Join us for a celebration of successful bathroom breaks as we guide you through this essential skill.', N'', CAST(N'2024-04-02T18:00:00.000' AS DateTime), 37)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (5, N'Leash Legends', N'Ready for walks without the drama? Leash Legends teaches loose leash walking and proper leash manners, ensuring enjoyable strolls for both you and your canine companion.', N'', CAST(N'2023-01-08T20:30:00.000' AS DateTime), 137)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (6, N'Clicker Capers', N'Click your way to success! This course introduces clicker training, a fun and effective method for teaching new behaviors and strengthening the bond between you and your pup.', N'', CAST(N'2023-09-22T17:00:00.000' AS DateTime), 156)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (7, N'Positive Paws Power', N'Harness the power of positivity! Positive reinforcement training focuses on rewarding good behavior, creating a happy and harmonious relationship between you and your pup.', N'', CAST(N'2023-04-04T19:00:00.000' AS DateTime), 58)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (8, N'Behavior Bonanza', N'Decode your dog''s behavior in this fascinating course. From understanding body language to addressing common issues, you''ll gain valuable insights into canine behavior.', N'', CAST(N'2023-04-08T18:30:00.000' AS DateTime), 37)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (9, N'Anxiety Avengers', N'Help your pup conquer anxiety and fear with the Anxiety Avengers! This course offers strategies and techniques to manage separation anxiety and build confidence in your furry friend.', N'', CAST(N'2023-07-14T11:00:00.000' AS DateTime), 171)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (10, N'Recall Rally', N'Ready, set, recall! Join the Recall Rally to master the art of coming when called. Whether in the park or at home, your pup will learn to respond promptly and reliably to your cue.', N'', CAST(N'2023-11-09T15:30:00.000' AS DateTime), 156)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (11, N'Obedience Odyssey', N'Embark on a journey of obedience mastery! This course covers fundamental commands like sit, stay, and down, providing a solid foundation for your pup''s training journey.', N'', CAST(N'2023-05-20T20:30:00.000' AS DateTime), 39)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (12, N'Socialization Safari', N'Join us for an exciting socialization adventure! This course offers structured play sessions to help your puppy develop essential social skills and build positive relationships.', N'', CAST(N'2023-04-13T13:30:00.000' AS DateTime), 94)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (13, N'Crate Comfort Quest', N'Transform the crate into a cozy retreat! In this course, you''ll learn how to introduce your puppy to their crate and make it a safe and comforting space they''ll love to relax in.', N'', CAST(N'2024-01-24T20:00:00.000' AS DateTime), 171)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (14, N'Potty Training Paradise', N'Say hello to a house-trained paradise! Potty Training Paradise teaches effective techniques to help your puppy master the art of potty training with ease and minimal accidents.', N'', CAST(N'2023-01-04T19:30:00.000' AS DateTime), 37)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (15, N'Leash Loungers', N'Relax and enjoy stress-free walks with Leash Loungers! This course focuses on teaching your pup to walk calmly on a leash, making outdoor adventures enjoyable for both of you.', N'', CAST(N'2023-03-29T18:30:00.000' AS DateTime), 82)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (16, N'Clicker Crusade', N'Join the Clicker Crusade and unleash the power of positive reinforcement! Learn how to use a clicker to communicate with your puppy and shape desirable behaviors effectively.', N'', CAST(N'2024-01-19T18:00:00.000' AS DateTime), 153)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (17, N'Positive Paw Prints', N'Leave behind a trail of positivity with Positive Paw Prints! This course emphasizes positive reinforcement techniques to encourage good behavior and strengthen your bond with your pup.', N'', CAST(N'2023-07-07T18:00:00.000' AS DateTime), 208)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (18, N'Behavior Bliss', N'Dive into the world of canine behavior with Behavior Bliss! Gain insights into why dogs behave the way they do and learn practical strategies for addressing common behavioral challenges.', N'', CAST(N'2024-04-30T20:00:00.000' AS DateTime), 249)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (19, N'Anxiety Alleviators', N'Help your pup overcome anxiety and build confidence with Anxiety Alleviators! This course provides tools and techniques to ease anxiety-related behaviors and promote emotional well-being.', N'', CAST(N'2024-02-09T14:00:00.000' AS DateTime), 171)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (20, N'Recall Rendezvous', N'Join the Recall Rendezvous for off-leash freedom! This course teaches reliable recall skills, empowering your pup to return to you promptly and safely, no matter the distractions.', N'', CAST(N'2024-02-13T17:00:00.000' AS DateTime), 208)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (21, N'Sit & Stay Soiree', N'Roll out the red carpet for good manners with Sit & Stay Soiree! This course focuses on teaching polite behaviors such as sitting and staying, ensuring your pup is the life of the party.', N'', CAST(N'2024-02-09T11:00:00.000' AS DateTime), 249)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (22, N'Playtime Palooza', N'Let the fun begin at Playtime Palooza! This course offers structured play sessions where puppies can socialize, learn appropriate play behavior, and burn off excess energy in a safe environment.', N'', CAST(N'2023-11-12T20:30:00.000' AS DateTime), 37)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (23, N'Crate Comfort Clinic', N'Make crate time comfortable and stress-free with Crate Comfort Clinic! Learn how to acclimate your puppy to their crate and transform it into a peaceful sanctuary they''ll adore.', N'', CAST(N'2023-08-28T12:30:00.000' AS DateTime), 171)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (24, N'Potty Party Palooza', N'Get ready to celebrate potty training success at Potty Party Palooza! This course provides practical tips and guidance to help your puppy become a potty training pro in no time.', N'', CAST(N'2023-09-22T19:00:00.000' AS DateTime), 37)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (25, N'Leash Legends Lounge', N'Lounge in style with Leash Legends Lounge! This course focuses on teaching loose leash walking and leash manners, making walks with your pup enjoyable and relaxed for both of you.', N'', CAST(N'2024-03-26T17:30:00.000' AS DateTime), 82)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (26, N'Clicker Charm School', N'Charm your way to obedience success with Clicker Charm School! Learn how to use clicker training to communicate effectively with your puppy and shape desired behaviors with precision.', N'', CAST(N'2024-03-15T17:00:00.000' AS DateTime), 153)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (27, N'Positive Reinforcement Playground', N'Let the games begin at Positive Reinforcement Playground! This course offers engaging activities and games designed to reinforce positive behaviors and strengthen your bond with your pup.', N'', CAST(N'2023-07-30T19:30:00.000' AS DateTime), 39)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (28, N'Behavior Breakthrough Bootcamp', N'Breakthrough behavioral barriers with Behavior Breakthrough Bootcamp! This intensive course provides practical strategies and techniques to address challenging behaviors and foster harmony at home.', N'', CAST(N'2023-07-09T18:30:00.000' AS DateTime), 58)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (29, N'Anxiety Annihilation Academy', N'Conquer anxiety with Anxiety Annihilation Academy! This course equips you with the tools and knowledge to help your pup overcome fear and anxiety, leading to a happier and more confident companion.', N'', CAST(N'2023-10-29T20:00:00.000' AS DateTime), 137)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (30, N'Recall Revolution Rally', N'Join the Recall Revolution Rally for off-leash adventures! This course focuses on building a reliable recall response in your puppy, allowing you to enjoy freedom and flexibility in your outdoor activities.', N'', CAST(N'2024-03-26T19:30:00.000' AS DateTime), 156)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (31, N'Stay & Wait Wonderland', N'Enter a world of patience and self-control at Stay & Wait Wonderland! This course teaches your pup the valuable skills of staying and waiting patiently, enhancing their impulse control and focus.', N'', CAST(N'2024-01-26T13:00:00.000' AS DateTime), 156)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (32, N'Socialization Spectacular', N'Experience the magic of socialization at Socialization Spectacular! This course provides structured opportunities for puppies to interact with peers and learn valuable social skills in a supervised setting.', N'', CAST(N'2023-12-12T12:30:00.000' AS DateTime), 82)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (33, N'Crate Cozy Corner', N'Create a cozy retreat for your pup at Crate Cozy Corner! This course teaches you how to make the crate a welcoming and comfortable space where your puppy can relax and unwind whenever needed.', N'', CAST(N'2023-06-01T18:30:00.000' AS DateTime), 56)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (34, N'Potty Training Party', N'Join the party and master potty training with Potty Training Party! This course offers effective strategies and techniques to help your puppy achieve success in their potty training journey with ease.', N'', CAST(N'2023-10-31T20:30:00.000' AS DateTime), 37)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (35, N'Leash Walking Wonderland', N'Step into Leash Walking Wonderland for stress-free walks! This course focuses on teaching your puppy to walk politely on a leash, making outings enjoyable and harmonious for both of you.', N'', CAST(N'2023-02-07T18:30:00.000' AS DateTime), 58)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (36, N'Clicker Training Treasure Trove', N'Discover the treasure of clicker training at Clicker Training Treasure Trove! This course introduces you to the power of clicker training and how it can be used to shape desired behaviors in your puppy.', N'', CAST(N'2023-10-21T18:00:00.000' AS DateTime), 153)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (37, N'Positive Puppy Playhouse', N'Welcome to the Positive Puppy Playhouse, where learning is fun! This course provides engaging activities and games designed to reinforce positive behaviors and strengthen the bond between you and your puppy.', N'', CAST(N'2024-03-03T18:00:00.000' AS DateTime), 94)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (38, N'Behavior Balance Bootcamp', N'Achieve balance and harmony with Behavior Balance Bootcamp! This intensive course equips you with the tools and strategies to address behavioral challenges and foster a positive relationship with your pup.', N'', CAST(N'2023-10-01T17:00:00.000' AS DateTime), 39)
INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (39, N'Anxiety Alleviation Avenue', N'Take a stroll down Anxiety Alleviation Avenue and leave anxiety behind! This course offers practical techniques and support to help your puppy overcome fear and anxiety, leading to a happier and more confident companion.', N'', CAST(N'2023-08-10T19:00:00.000' AS DateTime), 171)
