INSERT [dbo].[Courses] ([courseID], [name], [description], [photo], [date], [trainerID]) VALUES (41, N'Manners & More Masterclass', N'Elevate your pup''s manners with Manners & More Masterclass! This comprehensive course covers essential obedience commands and polite behaviors, setting the stage for a well-behaved and well-mannered companion.', N'', CAST(N'2023-08-17T18:00:00.000' AS DateTime), 58)
