INSERT [dbo].[Trainers] ([trainerID], [specialty], [description]) VALUES (171, N'Anxiety Management', N'"Zen Master" Macdonald specializes in anxiety management, offering compassionate support to puppies facing fear or stress. With his understanding and gentle approach, he helps puppies build confidence and overcome anxiety-related challenges.')
INSERT [dbo].[Trainers] ([trainerID], [specialty], [description]) VALUES (208, N'Socialization', N'Burke excels in socialization, providing puppies with enriching experiences to develop essential social skills. Through carefully planned activities and positive reinforcement, he fosters confident and well-adjusted companions.')
